webpackJsonp([27565055981225],{3743:function(a,t){a.exports={data:{markdownRemark:{html:'<p>2005年夏まで活躍していたSC-88Pro互換GS音源。音そのものは大好きなんだが、遅延が酷くて他の音源とコラボ出来ないのが難点。これじゃあVSTi版が付いてても真価を発揮しきれない…orz 夏コミ終わったら何買うかな、何でもいいからハードウェアの音源が欲しい…。あぁ、CM-32Lは近くのジャンク屋で3桁で売ってたけど流石に勘弁で。  <a href="/oasys88">KORG OASYS88</a>がメインになってからもシーケンスだけはPC上でやっているのでその際に活躍中。しかし、Vista以降との相性がすこぶる悪いので、ここ数年は完全にHDDの肥やし状態。 後継として(というよりも後方互換としてだが)、2011年に<a href="/sc-88pro">Roland SC-88Proを購入</a>。</p>',frontmatter:{cover:null,date:"2004-10-01T00:00:00+09:00",strDate:"2004/9/30",title:"(2004-2009) Roland VSC-MP1"}}},pathContext:{path:"/ja/blog/2004/10/01-vsc-mp1/",langKey:"ja"}}}});
